Create Database Seven_Kingdoms
Use Seven_Kingdoms


-- Table 1: Order
CREATE TABLE Customer_Order (
    order_id INT PRIMARY KEY IDENTITY(1,1),
    order_date DATE NOT NULL,
    order_time TIME NOT NULL,
    total_price DECIMAL(10,2) NOT NULL,
    payment_method VARCHAR(50) NOT NULL
);

-- Table 2: Hamburger
CREATE TABLE Hamburger (
    hamburger_id INT PRIMARY KEY IDENTITY(1,1),
    hamburger_name VARCHAR(100) NOT NULL,
    price DECIMAL(10,2) NOT NULL,
    category_id INT NOT NULL,
    FOREIGN KEY (category_id) REFERENCES Category(category_id)
);



-- Table 3: Hamburguer Order
CREATE TABLE Hamburger_Order (
    order_id INT NOT NULL,
    hamburger_id INT NOT NULL,
    quantity INT NOT NULL,
    PRIMARY KEY (order_id, hamburger_id),
    FOREIGN KEY (order_id) REFERENCES Customer_Order(order_id),
    FOREIGN KEY (hamburger_id) REFERENCES Hamburger(hamburger_id)
);

-- Table 4: Hamburger Recipe
CREATE TABLE Hamburger_Recipe (
    hamburger_id INT NOT NULL,
    ingredient_id INT NOT NULL,
    PRIMARY KEY (hamburger_id, ingredient_id),
    FOREIGN KEY (hamburger_id) REFERENCES Hamburger(hamburger_id),
    FOREIGN KEY (ingredient_id) REFERENCES Ingredient(ingredient_id)
);

-- Table 5: Ingredient
CREATE TABLE Ingredient (
    ingredient_id INT PRIMARY KEY IDENTITY(1,1),
    ingredient_name VARCHAR(100) NOT NULL
);

-- Table 6: Category
CREATE TABLE Category (
    category_id INT PRIMARY KEY IDENTITY(1,1),
    category_name VARCHAR(50) NOT NULL
);


