CREATE TRIGGER calculate_total_price
ON Hamburger_Order
AFTER INSERT
AS
BEGIN
    UPDATE Customer_Order
    SET total_price = (
        SELECT SUM(h.price * ho.quantity)
        FROM Hamburger_Order ho
        JOIN Hamburger h ON ho.hamburger_id = h.hamburger_id
        WHERE ho.order_id = inserted.order_id
    )
    FROM inserted
    WHERE Customer_Order.order_id = inserted.order_id;
END;







Select * from Customer_Order

SELECT 
    co.order_id,
    co.order_date,
    co.order_time,
    h.hamburger_name,
    h.price,
    ho.quantity,
    co.total_price,
    co.payment_method,
    c.category_name,
    STRING_AGG(i.ingredient_name, ', ') AS ingredient_names
FROM 
    Customer_Order co
JOIN 
    Hamburger_Order ho ON co.order_id = ho.order_id
JOIN 
    Hamburger h ON ho.hamburger_id = h.hamburger_id
JOIN 
    Category c ON h.category_id = c.category_id
JOIN 
    Hamburger_Recipe hr ON h.hamburger_id = hr.hamburger_id
JOIN 
    Ingredient i ON hr.ingredient_id = i.ingredient_id
GROUP BY 
    co.order_id, co.order_date, co.order_time, h.hamburger_name, 
    h.price, ho.quantity, co.total_price, co.payment_method, c.category_name
ORDER BY 
    co.order_id;


	use 


	--TOTAL REVENUE--- /

	Select SUM(total_price) AS Total_Revenue from Customer_Order

	-- AVG TOTAL VALUE /
	Select SUM(total_price) / COUNT(DISTINCT order_id) as Avg_Order_value from Customer_Order

	-- TOTAL HAMBURGER SOLD /
	SELECT SUM(quantity) AS Total_hamburger_sold FROM Hamburger_Order

	--TOTAL ORDERS /
	SELECT COUNT(DISTINCT order_id) AS Total_Orders FROM Customer_Order

	--AVG HAMBURGER PER ORDER / 
	SELECT CAST(CAST(SUM(quantity) AS DECIMAL(10,2)) / 
	CAST(COUNT(DISTINCT order_id) AS DECIMAL(10,2)) AS DECIMAL(10,2))
	AS Avg_Pizzas_per_order
	FROM Hamburger_Order

	--DAILY TREND FOR TOTAL ORDERS
	SELECT DATENAME(DW, order_date) AS order_day, COUNT(DISTINCT order_id) AS total_orders 
	FROM Customer_Order
	GROUP BY DATENAME(DW, order_date)

	--MONTHLY TrEND FOR ORDERS
	select DATENAME(MONTH, order_date) as Month_Name, COUNT(DISTINCT order_id) as Total_Orders
	from Customer_Order
	GROUP BY DATENAME(MONTH, order_date)

	-- % of SALES BY HAMBURGER CATEGORY
	SELECT c.category_name AS category, 
    CAST(SUM(h.price * ho.quantity) AS DECIMAL(10,2)) AS total_revenue,
    CAST(SUM(h.price * ho.quantity) * 100.0 / 
         (SELECT SUM(h2.price * ho2.quantity) 
          FROM Hamburger_Order ho2
          JOIN Hamburger h2 ON ho2.hamburger_id = h2.hamburger_id) AS DECIMAL(10,2)) AS PTC
FROM 
    Hamburger_Order ho
JOIN 
    Hamburger h ON ho.hamburger_id = h.hamburger_id
JOIN 
    Category c ON h.category_id = c.category_id
GROUP BY 
    c.category_name
ORDER BY 
    total_revenue DESC;


	-- TOTAL HAMBURGER SOLD BY HAMBURGER  CATEGORY 

	SELECT 
    c.category_name AS hamburger_category, 
    SUM(ho.quantity) AS total_quantity_sold
FROM 
    Hamburger_Order ho
JOIN 
    Hamburger h ON ho.hamburger_id = h.hamburger_id
JOIN 
    Category c ON h.category_id = c.category_id
JOIN 
    Customer_Order co ON ho.order_id = co.order_id
WHERE 
    MONTH(co.order_date) = 2
GROUP BY 
    c.category_name
ORDER BY 
    total_quantity_sold DESC;


	--TOP 5 HAMBURGER  BY REVENUE
	SELECT TOP 5 
    h.hamburger_name, 
    CAST(SUM(h.price * ho.quantity) AS DECIMAL(10,2)) AS total_revenue
	FROM 
    Hamburger_Order ho
	JOIN 
    Hamburger h ON ho.hamburger_id = h.hamburger_id
	GROUP BY 
    h.hamburger_name
	ORDER BY 
    total_revenue DESC;

		--BOTTOM 5 HAMBURGER  BY REVENUE
	SELECT TOP 5 
    h.hamburger_name, 
    CAST(SUM(h.price * ho.quantity) AS DECIMAL(10,2)) AS total_revenue
	FROM 
    Hamburger_Order ho
	JOIN 
    Hamburger h ON ho.hamburger_id = h.hamburger_id
	GROUP BY 
    h.hamburger_name
	ORDER BY 
    total_revenue ASC;

	--TOP 5 HAMBURGER BY QUANTITY
	SELECT TOP 5 
    h.hamburger_name, 
    CAST(SUM(ho.quantity) AS DECIMAL(10,2)) AS total_sold
	FROM 
    Hamburger_Order ho
	JOIN 
    Hamburger h ON ho.hamburger_id = h.hamburger_id
	GROUP BY 
    h.hamburger_name
	ORDER BY 
    total_sold DESC;

	--BOTTOM 5 HAMBURGER BY QUANTITY
	SELECT TOP 5 
    h.hamburger_name, 
    CAST(SUM(ho.quantity) AS DECIMAL(10,2)) AS total_sold
	FROM 
    Hamburger_Order ho
	JOIN 
    Hamburger h ON ho.hamburger_id = h.hamburger_id
	GROUP BY 
    h.hamburger_name
	ORDER BY 
    total_sold ASC;

	--TOP 5 HAMBURGER BY TOTAL ORDERS

	SELECT TOP 5 
    h.hamburger_name, 
    COUNT(DISTINCT ho.order_id) AS total_orders
FROM 
    Hamburger_Order ho
JOIN 
    Hamburger h ON ho.hamburger_id = h.hamburger_id
GROUP BY 
    h.hamburger_name
ORDER BY 
    total_orders DESC;


	--BOTTOM 5 HAMBURGER BY TOTAL ORDERS

	SELECT TOP 5 
    h.hamburger_name, 
    COUNT(DISTINCT ho.order_id) AS total_orders
FROM 
    Hamburger_Order ho
JOIN 
    Hamburger h ON ho.hamburger_id = h.hamburger_id
GROUP BY 
    h.hamburger_name
ORDER BY 
    total_orders ASC;